  false,\n\t\"url\": null,\n\t\"notes\": \"The \"Syria IDP Sites\" dataset is compiled
  by the U.S. Department of State, Humanitarian Information Unit (INR/GGI/HIU). This
  dataset contains open source derived data about the geographic locations (point
  geometry) of identified tent camps and other locations, such as collective centers,
  schools, mosques, sports facilities, host families, etc. in towns inside Syria where
  displacement has taken place. Sources of this information include the United Nations,
  the Assistance Coordination Unit, the Syria Needs Assessment Project, NGOs, and
  media reports. Location coordinates are at the city level and are plotted using
  the Syria P-Code system (http://www.mapaction.org/map-catalogue/mapdetail/2753.html)
  and NGA GEOnet Names Server (http://earth-info.nga.mil/gns/html) datasets. The field
  \"PCode\" is a combination of the all the administrative level and community level
  P-Codes for a specific location. Camp locations are verified using high-resolutions
  commercial satellite imagery. In the \"Designation\" field \"IDP Site\" refers to
  informal or formal settlements for specific IDP use. This dataset will be updated
  as needed and is current as of late June 2015.nnThis dataset is hosted on State
  GeoNode at http://geonode.state.gov/layers/geonode%3ASyria_IDPSites_2015LateJun_HIU_DoS.\",\n\t\"license_title\":
